            this.label14.TabIndex = 13;
            this.label14.Text = "    1.请按照预约时间到达候诊，服从工作人员的安排，严禁大声喧哗，禁止吸烟，住院病人请穿好病人服，门诊病人不要穿着带任何金属的衣裤，进入检查室前请更换放置ＭＲ" +
                "室外的拖鞋。";
            // 
            // label15
            // 
            this.label15.Font = new System.Drawing.Font("宋体", 9F, System.Drawing.FontStyle.Bold, System.Drawing.GraphicsUnit.Point, ((byte)(134)));
            this.label15.Location = new System.Drawing.Point(31, 311);
            this.label15.Margin = new System.Windows.Forms.Padding(0);
            this.label15.Name = "label15";
            this.label15.Size = new System.Drawing.Size(516, 79);
            this.label15.TabIndex = 14;
            this.label15.Text = "    2.所有金属物品严禁带在身上进行检查，以免发生危险。发夹、发卡、项链、女士的胸罩、手表、皮带、硬币、钥匙、小刀、宫内金属节育环、可拆除的金属假牙等金属物品" +
                "务必在检查前除掉。此外，磁卡、信用卡、手机等亦不能携带进入检查，请听从工作人员安排放在指定的地方。如脸上有浓妆者请擦掉。";
            // 
