            this.label16.Name = "label16";
            this.label16.Size = new System.Drawing.Size(516, 38);
            this.label16.TabIndex = 15;
            this.label16.Text = "    3.带有人工角膜、人工听骨、支架、铁磁性止血夹、动脉瘤夹等体内金属异物及电子辅助装置和幽闭恐惧患者严禁做此项检查。";
